import Carousel from 'react-bootstrap/Carousel';
import idea from '../../assets/carousel/idea.jpg';
import main from '../../assets/carousel/main.jpg';
import help from '../../assets/carousel/help.jpg';
import 'bootstrap/dist/css/bootstrap.css';
import './index.css';

function carousel() {
  return (
      <Carousel fade prevIcon={<span aria-hidden="true" className="carousel-control-prev-icon" />}>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={help}
            alt="Third slide"
          />

          <Carousel.Caption>
            <h3>Third slide label</h3>
            <p>
              Praesent commodo cursus magna, vel scelerisque nisl consectetur.
            </p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
  );
}

export default carousel;
